import React from 'react';
import { Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles( theme => {

    return {
        dispTag:{
            display:'flex',
            gap:'10px',
            padding:'8px',
            fontSize:'14px',
            borderRadius:'3px',
            
            border:'1px solid black'
        },
        dispX:{
            backgroundColor:'red'
        }
    }
    
});


export const Filter = ({fil}) => {
    

    const {dispTag,dispX} = useStyles();

    return (

            <Grid item>
                <span className={dispTag}>{fil}
                    <span className={dispX}>X</span>
                </span>
            </Grid>
                
            
            
          
                       

         

    )
}
